import React from 'react';

class About extends React.Component {
  render() {
    return (
      <div>
        <h1>
          Pedrita!
        </h1>
        <p>
          Sou uma dog dorminhoca.
        </p>
        <h2>Minhas Habilidades</h2>
        <ul>
          <li>Dormir</li>
          <li>Comer</li>
          <li>Latir</li>                    
        </ul>
      </div>
    );
  }
}

export default About;
